rrm_length_t
rrm_il_get_rrc_rrm_ue_sync_status_len
(
    rrc_rrm_ue_sync_status_t *p_rrc_rrm_ue_sync_status
)
{
    rrm_length_t length = 0;

    RRM_ASSERT(p_rrc_rrm_ue_sync_status != PNULL);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_rrc_rrm_ue_sync_status->bitmask);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_rrc_rrm_ue_sync_status->ue_index);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_rrc_rrm_ue_sync_status->rrc_rrm_ue_sync_status);

    return length;
}

rrm_return_et
rrm_il_compose_rrc_rrm_ue_sync_status
(
    U8  **pp_buffer,
    rrc_rrm_ue_sync_status_t *p_rrc_rrm_ue_sync_status
)
{
    RRM_ASSERT(pp_buffer != PNULL);
    RRM_ASSERT(*pp_buffer != PNULL);
    RRM_ASSERT(p_rrc_rrm_ue_sync_status != PNULL);

    /* This function composes rrc_rrm_ue_sync_status */
    

    /* Compose parameter of basic type */
    rrm_cp_pack_U16(*pp_buffer, &p_rrc_rrm_ue_sync_status->bitmask, "bitmask");
    *pp_buffer += sizeof(p_rrc_rrm_ue_sync_status->bitmask);

    /* Compose parameter of basic type */
    rrm_cp_pack_U16(*pp_buffer, &p_rrc_rrm_ue_sync_status->ue_index, "ue_index");
    *pp_buffer += sizeof(p_rrc_rrm_ue_sync_status->ue_index);

    /* Check for correct range [H - higher boundary] */
    if ((p_rrc_rrm_ue_sync_status->rrc_rrm_ue_sync_status > 2))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_rrc_rrm_ue_sync_status->rrc_rrm_ue_sync_status] should be less than"
            " or equal to 2. Incorrect value %u received.", p_rrc_rrm_ue_sync_status->rrc_rrm_ue_sync_status);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U32(*pp_buffer, &p_rrc_rrm_ue_sync_status->rrc_rrm_ue_sync_status, "rrc_rrm_ue_sync_status");
    *pp_buffer += sizeof(p_rrc_rrm_ue_sync_status->rrc_rrm_ue_sync_status);

    return RRM_SUCCESS;
}

/******************************************************************************
*   FUNCTION NAME: rrm_il_send_rrc_rrm_ue_sync_status
*
*   DESCRIPTION:
*       This function constructs and sends RRC_RRM_UE_SYNC_STATUS message
*
*   RETURNS:
*       RRM_FAILURE     - Indicates failed message processing
*       RRM_SUCCESS     - Indicates successful message processing
*
******************************************************************************/
rrm_return_et
rrm_il_send_rrc_rrm_ue_sync_status
(
    rrc_rrm_ue_sync_status_t  *p_rrc_rrm_ue_sync_status,           /* Pointer to API specific information. */
    U16                 src_module_id,  /* Source module identifier */
    U16                 dst_module_id,  /* Destination module identifier */
    U16                 transaction_id, /* Interface transaction identifier */
    U8                  cell_index      /* cell index */
)
{
    U16 msg_length, msg_api_length;
    U8 *p_msg, *p_rrm_msg;

    RRM_ASSERT(p_rrc_rrm_ue_sync_status != PNULL);

    SET_CELL_INDEX(cell_index);

    /* Get API length */
    msg_length = rrm_il_get_rrc_rrm_ue_sync_status_len(p_rrc_rrm_ue_sync_status);
    
    if(msg_length == RRM_FAILURE)
        {
            return RRM_FAILURE;
    }
    RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_INFO, "Src(%u)->Dst(%u):RRC_RRM_UE_SYNC_STATUS", src_module_id, dst_module_id);

    msg_api_length = msg_length + RRM_API_HEADER_SIZE + RRM_INTERFACE_API_HEADER_SIZE;

    /* Allocate buffer */
    p_msg = rrm_msg_mem_get(msg_api_length);

    if (p_msg == PNULL)
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_ERROR, "Memory allocation to p_msg failed."
                " Cannot send message");
        /* Not enough memory */
        return RRM_FAILURE;
    }

    RRM_MEMSET(p_msg, 0, msg_api_length);
    p_rrm_msg = p_msg;

    /* Fill CSPL header */
    rrm_construct_api_header(p_rrm_msg, RRC_VERSION_ID, src_module_id,
        dst_module_id, RRC_RRM_UE_SYNC_STATUS, msg_api_length);

    /* Fill interface header */
    p_rrm_msg = p_rrm_msg + RRM_API_HEADER_SIZE;
    rrm_construct_interface_api_header(p_rrm_msg, transaction_id, src_module_id,
        dst_module_id, RRC_RRM_UE_SYNC_STATUS, msg_length,cell_index);

    /* Fill RRC_RRM_UE_SYNC_STATUS message */
    p_rrm_msg = p_rrm_msg + RRM_INTERFACE_API_HEADER_SIZE;
    if (RRM_FAILURE == rrm_il_compose_rrc_rrm_ue_sync_status(&p_rrm_msg, p_rrc_rrm_ue_sync_status))
    {
        rrm_msg_mem_free(p_msg);

        return RRM_FAILURE;
    }

    if((p_rrm_msg - msg_api_length) != p_msg)
    {
        rrm_msg_mem_free(p_msg);

        return RRM_FAILURE;
    }

    /* Send message to */
    rrm_send_message(p_msg, dst_module_id);

    return RRM_SUCCESS;
}

