    rrm_cp_pack_U16(*pp_buffer, &p_rrc_rrm_cell_reconfig_req->contention_free_rach_timer, "contention_free_rach_timer");
    *pp_buffer += sizeof(p_rrc_rrm_cell_reconfig_req->contention_free_rach_timer);
