    {
        return RRM_FAILURE;
    }

    /* Compose IE */
    if (RRM_FAILURE == rrm_il_compose_rrc_mac_config(pp_buffer, &p_rrc_rrm_cell_config->mac_config))
    {
        return RRM_FAILURE;
    }

    /* Compose IE */
    if (RRM_FAILURE == rrm_il_compose_rrc_lower_layer_comm_info(pp_buffer, &p_rrc_rrm_cell_config->l2_comm_info_params))
    {
        return RRM_FAILURE;
    }

    /* Optional element */
    if(p_rrc_rrm_cell_config->bitmask & RRC_RRM_ASSOCIATED_LAYER2_INST_FIELD_PRESENT)
    {

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_rrc_rrm_cell_config->associated_layer2_inst, "associated_layer2_inst");
    *pp_buffer += sizeof(p_rrc_rrm_cell_config->associated_layer2_inst);
    }

    /* Optional element */
    if(p_rrc_rrm_cell_config->bitmask & RRC_RRM_ASSOCIATED_PDCP_INST_FIELD_PRESENT)
    {

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_rrc_rrm_cell_config->associated_pdcp_inst, "associated_pdcp_inst");
    *pp_buffer += sizeof(p_rrc_rrm_cell_config->associated_pdcp_inst);
    }

    /* Optional element */
    if(p_rrc_rrm_cell_config->bitmask & RRC_RRM_ASSOCIATED_RLC_INST_FIELD_PRESENT)
    {

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_rrc_rrm_cell_config->associated_rlc_inst, "associated_rlc_inst");
    *pp_buffer += sizeof(p_rrc_rrm_cell_config->associated_rlc_inst);
    }

    /* Optional element */
    if(p_rrc_rrm_cell_config->bitmask & RRC_RRM_ASSOCIATED_MAC_INST_FIELD_PRESENT)
    {

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_rrc_rrm_cell_config->associated_mac_inst, "associated_mac_inst");
    *pp_buffer += sizeof(p_rrc_rrm_cell_config->associated_mac_inst);
    }

    return RRM_SUCCESS;
