static
rrm_return_et
rrm_il_compose_EmtcCellParam
(
    U8  **pp_buffer,
    EmtcCellParam *p_EmtcCellParam
)
{
    RRM_ASSERT(pp_buffer != PNULL);
    RRM_ASSERT(*pp_buffer != PNULL);
    RRM_ASSERT(p_EmtcCellParam != PNULL);

    /* This function composes EmtcCellParam */
    

    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_EmtcCellParam->operationMode < 1) || (p_EmtcCellParam->operationMode > EMTC_OPERATION_MODE_MAX))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_EmtcCellParam->operationMode] should be in range "
            "1 to EMTC_OPERATION_MODE_MAX. Incorrect value %u received.", p_EmtcCellParam->operationMode);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_EmtcCellParam->operationMode, "operationMode");
    *pp_buffer += sizeof(p_EmtcCellParam->operationMode);

    /* Check for correct range [H - higher boundary] */
    if ((p_EmtcCellParam->duplexingMode > EMTC_DUPLEXING_MODE_MAX))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_EmtcCellParam->duplexingMode] should be less than"
            " or equal to EMTC_DUPLEXING_MODE_MAX. Incorrect value %u received.", p_EmtcCellParam->duplexingMode);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_EmtcCellParam->duplexingMode, "duplexingMode");
    *pp_buffer += sizeof(p_EmtcCellParam->duplexingMode);

    /* Check for correct range [H - higher boundary] */
    if ((p_EmtcCellParam->transmissionType > EMTC_TRANSMISSION_TYPE_MAX))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_EmtcCellParam->transmissionType] should be less than"
            " or equal to EMTC_TRANSMISSION_TYPE_MAX. Incorrect value %u received.", p_EmtcCellParam->transmissionType);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_EmtcCellParam->transmissionType, "transmissionType");
    *pp_buffer += sizeof(p_EmtcCellParam->transmissionType);

    /* Compose IE */
    if (RRM_FAILURE == rrm_il_compose_RrcUeSpecificNarrowbands(pp_buffer, &p_EmtcCellParam->ueSpecificNarrowbands))
    {
        return RRM_FAILURE;
    }

    return RRM_SUCCESS;
}

