static
rrm_length_t
rrm_il_get_rat_type_info_len
(
    rat_type_info_t *p_rat_type_info
)
{
    rrm_length_t length = 0;

    RRM_ASSERT(p_rat_type_info != PNULL);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_rat_type_info->rat_type_count);
    /* Get length of OCTET_STRING VARIABLE of basic type elements */
    length += (p_rat_type_info->rat_type_count * sizeof(p_rat_type_info->rat_type[0]));

    return length;
}

static
rrm_return_et
rrm_il_compose_rat_type_info
(
    U8  **pp_buffer,
    rat_type_info_t *p_rat_type_info
)
{
    RRM_ASSERT(pp_buffer != PNULL);
    RRM_ASSERT(*pp_buffer != PNULL);
    RRM_ASSERT(p_rat_type_info != PNULL);

    /* This function composes rat_type_info */
    

    /* Check for correct range [H - higher boundary] */
    if ((p_rat_type_info->rat_type_count > MAX_RAT_CAPABILITY))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_rat_type_info->rat_type_count] should be less than"
            " or equal to MAX_RAT_CAPABILITY. Incorrect value %u received.", p_rat_type_info->rat_type_count);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_rat_type_info->rat_type_count, "rat_type_count");
    *pp_buffer += sizeof(p_rat_type_info->rat_type_count);

    /* Compose OCTET_STRING VARIABLE of basic type elements */
    {
        rrc_counter_t loop;
        for (loop = 0; loop < p_rat_type_info->rat_type_count; loop++)
        {
            rrm_cp_pack_U8(*pp_buffer, &p_rat_type_info->rat_type[loop], "rat_type[]");
            *pp_buffer += sizeof(U8);
        }
    }

    return RRM_SUCCESS;
}

