/******************************************************************************
*   FUNCTION NAME: rrm_il_send_rrc_rrm_ue_capability_ind
*
*   DESCRIPTION:
*       This function constructs and sends RRC_RRM_UE_CAPABILITY_IND message
*
*   RETURNS:
*       RRM_FAILURE     - Indicates failed message processing
*       RRM_SUCCESS     - Indicates successful message processing
*
******************************************************************************/
rrm_return_et
rrm_il_send_rrc_rrm_ue_capability_ind
(
    rrc_rrm_ue_capability_ind_t  *p_rrc_rrm_ue_capability_ind,           /* Pointer to API specific information. */
    U16                 src_module_id,  /* Source module identifier */
    U16                 dst_module_id,  /* Destination module identifier */
    U16                 transaction_id, /* Interface transaction identifier */
    U8                  cell_index      /* cell index */
)
{
    U16 msg_length, msg_api_length;
    U8 *p_msg, *p_rrm_msg;

    RRM_ASSERT(p_rrc_rrm_ue_capability_ind != PNULL);

    SET_CELL_INDEX(cell_index);

    /* Get API length */
    msg_length = rrm_il_get_rrc_rrm_ue_capability_ind_len(p_rrc_rrm_ue_capability_ind);
    
    if(msg_length == RRM_FAILURE)
        {
            return RRM_FAILURE;
    }
    RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_INFO, "Src(%u)->Dst(%u):RRC_RRM_UE_CAPABILITY_IND", src_module_id, dst_module_id);

    msg_api_length = msg_length + RRM_API_HEADER_SIZE + RRM_INTERFACE_API_HEADER_SIZE;

    /* Allocate buffer */
    p_msg = rrm_msg_mem_get(msg_api_length);

    if (p_msg == PNULL)
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_ERROR, "Memory allocation to p_msg failed."
                " Cannot send message");
        /* Not enough memory */
        return RRM_FAILURE;
    }

    RRM_MEMSET(p_msg, 0, msg_api_length);
    p_rrm_msg = p_msg;

    /* Fill CSPL header */
    rrm_construct_api_header(p_rrm_msg, RRC_VERSION_ID, src_module_id,
        dst_module_id, RRC_RRM_UE_CAPABILITY_IND, msg_api_length);

    /* Fill interface header */
    p_rrm_msg = p_rrm_msg + RRM_API_HEADER_SIZE;
    rrm_construct_interface_api_header(p_rrm_msg, transaction_id, src_module_id,
        dst_module_id, RRC_RRM_UE_CAPABILITY_IND, msg_length,cell_index);

    /* Fill RRC_RRM_UE_CAPABILITY_IND message */
    p_rrm_msg = p_rrm_msg + RRM_INTERFACE_API_HEADER_SIZE;
    if (RRM_FAILURE == rrm_il_compose_rrc_rrm_ue_capability_ind(&p_rrm_msg, p_rrc_rrm_ue_capability_ind))
    {
        rrm_msg_mem_free(p_msg);

        return RRM_FAILURE;
    }

    if((p_rrm_msg - msg_api_length) != p_msg)
    {
        rrm_msg_mem_free(p_msg);

        return RRM_FAILURE;
    }

    /* Send message to */
    rrm_send_message(p_msg, dst_module_id);

    return RRM_SUCCESS;
}

