static
rrm_length_t
rrm_il_get_channel_record_len
(
    channel_record_t *p_channel_record
)
{
    rrm_length_t length = 0;

    RRM_ASSERT(p_channel_record != PNULL);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_channel_record->bitmask);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_channel_record->system_type);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_channel_record->band_class);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_channel_record->channel_number);

    return length;
}

static
rrm_return_et
rrm_il_compose_channel_record
(
    U8  **pp_buffer,
    channel_record_t *p_channel_record
)
{
    RRM_ASSERT(pp_buffer != PNULL);
    RRM_ASSERT(*pp_buffer != PNULL);
    RRM_ASSERT(p_channel_record != PNULL);

    /* This function composes channel_record */
    

    /* Compose parameter of basic type */
    rrm_cp_pack_U16(*pp_buffer, &p_channel_record->bitmask, "bitmask");
    *pp_buffer += sizeof(p_channel_record->bitmask);

    /* Check for correct range [H - higher boundary] */
    if ((p_channel_record->system_type > 2))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_channel_record->system_type] should be less than"
            " or equal to 2. Incorrect value %u received.", p_channel_record->system_type);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_channel_record->system_type, "system_type");
    *pp_buffer += sizeof(p_channel_record->system_type);

    /* Check for correct range [H - higher boundary] */
    if ((p_channel_record->band_class > 31))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_channel_record->band_class] should be less than"
            " or equal to 31. Incorrect value %u received.", p_channel_record->band_class);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_channel_record->band_class, "band_class");
    *pp_buffer += sizeof(p_channel_record->band_class);

    /* Check for correct range [H - higher boundary] */
    if ((p_channel_record->channel_number > 2047))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_channel_record->channel_number] should be less than"
            " or equal to 2047. Incorrect value %u received.", p_channel_record->channel_number);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U16(*pp_buffer, &p_channel_record->channel_number, "channel_number");
    *pp_buffer += sizeof(p_channel_record->channel_number);

    return RRM_SUCCESS;
}

static
rrm_length_t
rrm_il_get_pilot_entry_len
(
    pilot_entry_t *p_pilot_entry
)
{
    rrm_length_t length = 0;

    RRM_ASSERT(p_pilot_entry != PNULL);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_pilot_entry->bitmask);

    /* Get length of IE */
    length += rrm_il_get_channel_record_len(&p_pilot_entry->channel_record);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_pilot_entry->cell_id_info);

    /* Optional element */
    if(p_pilot_entry->bitmask & PILOT_ENTRY_1X_CELL_IDENTIFIER_PRESENT)
    {

    /* Get length of IE */
    length += rrm_il_get_cdma2000_1xrtt_cell_identifier_len(&p_pilot_entry->cdma2000_1xrtt_cell_id);
    }

    /* Optional element */
    if(p_pilot_entry->bitmask & PILOT_ENTRY_HRPD_SECTOR_IDENTIFIER_PRESENT)
    {

    /* Get length of IE */
    length += rrm_il_get_cdma2000_hrpd_sector_identifier_len(&p_pilot_entry->cdma2000_hrpd_sector_id);
    }

    /* Optional element */
    if(p_pilot_entry->bitmask & PILOT_ENTRY_REFERENCE_PILOT_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_pilot_entry->reference_pilot);
    }

    /* Optional element */
    if(p_pilot_entry->bitmask & PILOT_ENTRY_PILOT_PN_INFORMATION_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_pilot_entry->pilot_pn_info);
    }
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_pilot_entry->pilot_one_way_delay_included);

    /* Optional element */
    if(p_pilot_entry->bitmask & PILOT_ENTRY_PILOT_STRENGTH_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_pilot_entry->pilot_strength);
    }

    /* Optional element */
    if(p_pilot_entry->bitmask & PILOT_ENTRY_PILOT_ONE_WAY_DELAY_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_pilot_entry->pilot_one_way_delay);
    }

    return length;
}

