/******************************************************************************
*   FUNCTION NAME: rrm_il_send_rrc_rrm_ue_ho_command_response
*
*   DESCRIPTION:
*       This function constructs and sends RRC_RRM_UE_HO_CMD_RESP message
*
*   RETURNS:
*       RRM_FAILURE     - Indicates failed message processing
*       RRM_SUCCESS     - Indicates successful message processing
*
******************************************************************************/
rrm_return_et
rrm_il_send_rrc_rrm_ue_ho_command_response
(
    rrc_rrm_ue_ho_command_response_t  *p_rrc_rrm_ue_ho_command_response,           /* Pointer to API specific information. */
    U16                 src_module_id,  /* Source module identifier */
    U16                 dst_module_id,  /* Destination module identifier */
    U16                 transaction_id, /* Interface transaction identifier */
    U8                  cell_index      /* cell index */
)
{
    U16 msg_length, msg_api_length;
    U8 *p_msg, *p_rrm_msg;

    RRM_ASSERT(p_rrc_rrm_ue_ho_command_response != PNULL);

    SET_CELL_INDEX(cell_index);

    /* Get API length */
    msg_length = rrm_il_get_rrc_rrm_ue_ho_command_response_len(p_rrc_rrm_ue_ho_command_response);
    
    if(msg_length == RRM_FAILURE)
        {
            return RRM_FAILURE;
    }
    RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_INFO, "Src(%u)->Dst(%u):RRC_RRM_UE_HO_CMD_RESP", src_module_id, dst_module_id);

    msg_api_length = msg_length + RRM_API_HEADER_SIZE + RRM_INTERFACE_API_HEADER_SIZE;

    /* Allocate buffer */
    p_msg = rrm_msg_mem_get(msg_api_length);

    if (p_msg == PNULL)
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_ERROR, "Memory allocation to p_msg failed."
                " Cannot send message");
        /* Not enough memory */
        return RRM_FAILURE;
    }

    RRM_MEMSET(p_msg, 0, msg_api_length);
    p_rrm_msg = p_msg;

    /* Fill CSPL header */
    rrm_construct_api_header(p_rrm_msg, RRC_VERSION_ID, src_module_id,
        dst_module_id, RRC_RRM_UE_HO_CMD_RESP, msg_api_length);

    /* Fill interface header */
    p_rrm_msg = p_rrm_msg + RRM_API_HEADER_SIZE;
    rrm_construct_interface_api_header(p_rrm_msg, transaction_id, src_module_id,
        dst_module_id, RRC_RRM_UE_HO_CMD_RESP, msg_length,cell_index);

    /* Fill RRC_RRM_UE_HO_CMD_RESP message */
    p_rrm_msg = p_rrm_msg + RRM_INTERFACE_API_HEADER_SIZE;
    if (RRM_FAILURE == rrm_il_compose_rrc_rrm_ue_ho_command_response(&p_rrm_msg, p_rrc_rrm_ue_ho_command_response))
    {
        rrm_msg_mem_free(p_msg);

        return RRM_FAILURE;
    }

    if((p_rrm_msg - msg_api_length) != p_msg)
    {
        rrm_msg_mem_free(p_msg);

        return RRM_FAILURE;
    }

    /* Send message to */
    rrm_send_message(p_msg, dst_module_id);

    return RRM_SUCCESS;
}

static
rrm_length_t
rrm_il_get_ho_response_len
(
    ho_response_t *p_ho_response
)
{
    rrm_length_t length = 0;

    RRM_ASSERT(p_ho_response != PNULL);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_ho_response->bitmask);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_ho_response->response);

    /* Optional element */
    if(p_ho_response->bitmask & HO_RESPONSE_CAUSE_PRESENT)
    {

    /* Get length of IE */
    length += rrm_il_get_rrm_cause_len(&p_ho_response->rrm_cause);
    }

    /* Optional element */
    if(p_ho_response->bitmask & HO_RESPONSE_CS_FALLBACK_INDICATOR_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_ho_response->cs_fallback_indicator);
    }

    /* Optional element */
    if(p_ho_response->bitmask & ERAB_LIST_PRESENT)
    {

    /* Get length of IE */
    length += rrm_il_get_rrc_erab_info_list_len(&p_ho_response->erab_sub_to_fwd_list);
    }

    /* Optional element */
    if(p_ho_response->bitmask & HO_RESPONSE_CARRIER_FREQ_CDMA2000_PRESENT)
    {

    /* Get length of IE */
    length += rrm_il_get_carrier_freq_cdma2000_len(&p_ho_response->carrier_freq_cdma2000);
    }

    /* Optional element */
    if(p_ho_response->bitmask & HO_RESPONSE_ERAB_LOSSY_HO_LIST_PRESENT)
    {

    /* Get length of IE */
    length += rrm_il_get_erab_item_list_len(&p_ho_response->erab_lossy_ho_list);
    }

    return length;
}

static
rrm_return_et
rrm_il_compose_ho_response
(
    U8  **pp_buffer,
    ho_response_t *p_ho_response
)
{
    RRM_ASSERT(pp_buffer != PNULL);
    RRM_ASSERT(*pp_buffer != PNULL);
    RRM_ASSERT(p_ho_response != PNULL);

    /* This function composes ho_response */
    

    /* Compose parameter of basic type */
    rrm_cp_pack_U16(*pp_buffer, &p_ho_response->bitmask, "bitmask");
    *pp_buffer += sizeof(p_ho_response->bitmask);

    /* Check for correct range [H - higher boundary] */
    if ((p_ho_response->response > 1))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_ho_response->response] should be less than"
            " or equal to 1. Incorrect value %u received.", p_ho_response->response);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_ho_response->response, "response");
    *pp_buffer += sizeof(p_ho_response->response);

    /* Optional element */
    if(p_ho_response->bitmask & HO_RESPONSE_CAUSE_PRESENT)
    {

    /* Compose IE */
    if (RRM_FAILURE == rrm_il_compose_rrm_cause(pp_buffer, &p_ho_response->rrm_cause))
    {
        return RRM_FAILURE;
    }
    }

    /* Optional element */
    if(p_ho_response->bitmask & HO_RESPONSE_CS_FALLBACK_INDICATOR_PRESENT)
    {

    /* Check for correct range [H - higher boundary] */
    if ((p_ho_response->cs_fallback_indicator > 1))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_ho_response->cs_fallback_indicator] should be less than"
            " or equal to 1. Incorrect value %u received.", p_ho_response->cs_fallback_indicator);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_ho_response->cs_fallback_indicator, "cs_fallback_indicator");
    *pp_buffer += sizeof(p_ho_response->cs_fallback_indicator);
    }

    /* Optional element */
    if(p_ho_response->bitmask & ERAB_LIST_PRESENT)
    {

    /* Compose IE */
    if (RRM_FAILURE == rrm_il_compose_rrc_erab_info_list(pp_buffer, &p_ho_response->erab_sub_to_fwd_list))
    {
        return RRM_FAILURE;
    }
    }

    /* Optional element */
    if(p_ho_response->bitmask & HO_RESPONSE_CARRIER_FREQ_CDMA2000_PRESENT)
    {

    /* Compose IE */
    if (RRM_FAILURE == rrm_il_compose_carrier_freq_cdma2000(pp_buffer, &p_ho_response->carrier_freq_cdma2000))
    {
        return RRM_FAILURE;
    }
    }

    /* Optional element */
    if(p_ho_response->bitmask & HO_RESPONSE_ERAB_LOSSY_HO_LIST_PRESENT)
    {

    /* Compose IE */
    if (RRM_FAILURE == rrm_il_compose_erab_item_list(pp_buffer, &p_ho_response->erab_lossy_ho_list))
    {
        return RRM_FAILURE;
    }
    }

    return RRM_SUCCESS;
}

