static
rrm_length_t
rrm_il_get_drb_list_len
(
    drb_list_t *p_drb_list
)
{
    rrm_length_t length = 0;

    RRM_ASSERT(p_drb_list != PNULL);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_drb_list->drb_count);
    /* Get length of OCTET_STRING VARIABLE of basic type elements */
    length += (p_drb_list->drb_count * sizeof(p_drb_list->drb_Identity[0]));

    return length;
}

static
rrm_return_et
rrm_il_compose_drb_list
(
    U8  **pp_buffer,
    drb_list_t *p_drb_list
)
{
    RRM_ASSERT(pp_buffer != PNULL);
    RRM_ASSERT(*pp_buffer != PNULL);
    RRM_ASSERT(p_drb_list != PNULL);

    /* This function composes drb_list */
    

    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_drb_list->drb_count < 1) || (p_drb_list->drb_count > MAX_LC_COUNT))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_drb_list->drb_count] should be in range "
            "1 to MAX_LC_COUNT. Incorrect value %u received.", p_drb_list->drb_count);
        return RRM_FAILURE;
    }

    /* Compose parameter of basic type */
    rrm_cp_pack_U8(*pp_buffer, &p_drb_list->drb_count, "drb_count");
    *pp_buffer += sizeof(p_drb_list->drb_count);

    /* Compose OCTET_STRING VARIABLE of basic type elements with BOTH boundary 
     * range check */
    {
        rrc_counter_t loop;
        for (loop = 0; loop < p_drb_list->drb_count; loop++)
        {
            if ((p_drb_list->drb_Identity[loop] < 1) || (p_drb_list->drb_Identity[loop] > 32))
            {
                RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter p_drb_list->drb_Identity[%u] should be in "
                    "range 1 to 32. "
                    "Incorrect value %d received.", loop, p_drb_list->drb_Identity[loop]);
                return RRM_FAILURE;
            }
            rrm_cp_pack_U8(*pp_buffer, &p_drb_list->drb_Identity[loop], "drb_Identity[]");
            *pp_buffer += sizeof(U8);
        }
    }

    return RRM_SUCCESS;
}

