rrm_length_t
rrm_il_get_RstdInterFreqInfoList_len
(
    RstdInterFreqInfoList_t *p_RstdInterFreqInfoList
)
{
    rrm_length_t length = 0;

    RRM_ASSERT(p_RstdInterFreqInfoList != PNULL);
    /* Get length of parameter of basic type */
    length += (rrm_length_t)sizeof(p_RstdInterFreqInfoList->num_rstd_intfreq_list);

    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_RstdInterFreqInfoList->num_rstd_intfreq_list < 1) || (p_RstdInterFreqInfoList->num_rstd_intfreq_list > MAXRSTD_FREQ))
    {
        RRM_TRACE(RRM_TRUE, RRM_PNULL,RRM_WARNING, "Parameter [p_RstdInterFreqInfoList->num_rstd_intfreq_list] should be in range "
            "1 to MAXRSTD_FREQ. Incorrect value %d received.", p_RstdInterFreqInfoList->num_rstd_intfreq_list);
        return RRM_FAILURE;
    }

    /* Get length of OCTET_STRING VARIABLE of IEs */
    {
        rrc_counter_t loop;
        for (loop = 0; loop < p_RstdInterFreqInfoList->num_rstd_intfreq_list; loop++)
        {
            length += rrm_il_get_RstdInterFreqInfoList_r10_len(&p_RstdInterFreqInfoList->rstd_interfreq_list[loop]);
        }
    }

    return length;
}

